	add("mons", "{\"term\":\"mons\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|mōns||mountain}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the fleshy areas at the base of the fingers; a mount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The pubic mound or mons pubis. In human anatomy or in mammals in general, the mons pubis (Latin for \u0026quot;pubic mound\u0026quot;), also known as the mons veneris (Latin, mound of Venus) or simply the mons, is the adipose tissue lying above the pubic bone of adult females, anterior to the pubic symphysis. The mons pubis forms the anterior portion of the vulva\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mountain or extinct volcano on a planet or a moon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"w:Olympus Olympus Mons\u0027 (Mars\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"w:Maxwell Maxwell Montes\u0027 (Venus\", \"priority\":5}]}, \"synonyms\":{}}");

