	add("monarchianism", "{\"term\":\"monarchianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Monarchian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The beliefs of the Monarchians\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monarchy", "{\"term\":\"monarchy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|monarchie}}, from {{m|la|monarchia}}, from Ancient greek (to 1453) {{m|grc|μοναρχία}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A government in which sovereignty is embodied within a single, today usually hereditary head of state (whether as a figurehead or as a powerful ruler\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An absolute monarchy is a monarchy where the monarch is legally the ultimate authority in all temporal matters\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A constitutional monarchy is a monarchy in which the monarch\u0027s power is legally constrained, ranging from where minor concessions have been made to appease certain factions to where the monarch is a figurehead with all real power in the hands of a legislative body\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The territory ruled over by a monarch; a kingdom\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What scourge for perjury / Can this dark \u0027\u0027monarchy\u0027\u0027 afford false Clarence\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A form of government where sovereignty is embodied by a single ruler in a state and his high aristocracy representing their separate divided lands within the state and their low aristocracy representing their separate divided fiefs\", \"priority\":7}]}, \"synonyms\":{}}");

