	add("mondegreen", "{\"term\":\"mondegreen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by Sylvia Wright in \u0027w:Harper\u0027s Magazine|Harper’s Magazine\u0027 (\u0027The Death of Lady Mondegreen\u0027, Nov 1954) from a mishearing of a line in the Scottish ballad \u0027The Bonnie Earl O\u0027 Moray\u0027: \u0026quot;They have slain the Earl O\u0027 Moray, / And laid him on the green\u0026quot; (misheard as “Lady Mondegreen”).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of error arising from mishearing a spoken or sung phras\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A misunderstanding of a written or spoken phrase as a result of multiple definitions\", \"priority\":2}]}, \"synonyms\":{}}");

