	add("monger", "{\"term\":\"monger\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027mangere\u0027 (merchant, trader, dealer) from Proto-germanic {{m|gem-pro|*mangōną}}, from Latin \u0027\u0027lang\u003dla\u0027 \u0026quot;dealer, trader\u0026quot;, from Greek \u0027manganon\u0027 \u0026quot;contrivance, means of enchantment\u0026quot;, from Proto-indo-european {{m|ine-pro|*mang}} \u0026quot;to embellish, dress, trim\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dealer in a specific commodity, normally used in combinatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"costermonger, fishmonger, ironmonger\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person promoting something undesirable, always used in combinatio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"warmonger, sleazemonger, scaremonger\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A small merchant vessel\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In \u0027The Seaman\u0027s Manual\u0027 (1790), by Lt. Robert Wilson (RN), a monger is defined as \u0026quot;a small sea-vessel used by fishermen.\u0026quot\", \"priority\":6}]}, \"synonyms\":{}}");

	add("mongol", "{\"term\":\"mongol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Mongolian\"], \"text\":\"Romanisation of Mongolian \u0027монгол\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Mongolia; a Mongolian\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of any of the various Mongol ethnic groups living in The Mongolian People\u0027s Republic, the (former) USSR, Tibet and Nepal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"usually\u0027 \u0027\u0027mongol\u0027\u0027) A person with Down\u0027s syndrome\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d17|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe face which emerged was not reassuring.\u0026amp;nbsp;[…]. He was not a \u0027\u0027mongol\u0027\u0027 but there was a deficiency of a sort there, and it was not made more pretty by a latter-day hair cut which involved eccentrically long elf-locks and oiled black curls\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A member of the nomadic people from the steppes of central Asia who invaded Europe in the 13th Century. The mongol Empire stretched from the Eastern seas of China to the gates of Vienna\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Mathew Paris Chron. Maj. iv.76ff, Translated from The journey of William Rubruck (Hakluyt Society, 2nd series, no.4; 1900) pp. xv-xvi\u0027. \u0026lt;!-- This quote doesn\u0027t have the word that mongol in it !!! --\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They are inhuman and beastly, rather monsters than men, thirsting for and drinking blood, tearing and devouring the flesh of dogs and men, dressed in ox-hides, armed with plates of iron short, stout, thickset, strong, invincible, indefatigable, their backs unprotected, their breasts covered with armour...They have one-edged swords and daggers and spare neither age, nor sex nor condition\", \"priority\":7}]}, \"synonyms\":{}}");

	add("mongoose", "{\"term\":\"mongoose\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Marathi\", \"Portuguese\", \"Telugu\"], \"text\":\"From Portuguese \u0027mangus\u0027 () from Marathi \u0027मुंगूस\u0027 from Telugu \u0027sc\u003dtelu\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Carnivores of the family Herpestidae and the similar s (\u0027\u0027), ranging in size from small rats to large cats, including the famed as a predator of venomous snakes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mongrel", "{\"term\":\"mongrel\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Late 15th century, from obsolete \u0027mong\u0027 (mixture) {suffix||rel|t2\u003d(pejorative)|lang\u003den}}; from Old english (ca. 450-1100) \u0027gemong\u0027 (mingling) (whence Modern English \u0027among\u0027 , from Proto-germanic {{m|gem-pro|*mang-||mix}}.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone or something of mixed kind or uncertain origin; \u0027especially\u0027, a dog that is such\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That dog is a \u0027\u0027mongrel\u0027\u0027, who knows what breed it could be\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A thuggish, obnoxious, or contemptible person; a pitiable person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This poor mongrel\u0027s sitting in a bar, you see... (w:Maurie Maurie Fields\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jim Brigginshaw, \u0027Over My Dead Body\u0027, [https://books.google.com.tr/books?id\u003dXgK-NRyxm9oC\u0026amp;pg\u003dPA77\u0026amp;dq\u003d%22mongrel%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CDEQ6AEwBDgKahUKEwiN2oSkjq3HAhWKWhoKHSeNB1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dmongrel\u0026amp;f\u003dfalse page 77\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Yanto bloody Evans!\u0026quot; Jack stuttered with rage. \u0026quot;\u0027Yanto bloody Evans!\u0027 That... that... bloody mongrel! D\u0027you know who he is? He\u0027s the one who knocked me back for a bit of extra timber before the roof fell in on me!\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

