	add("monition", "{\"term\":\"monition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027monicion\u0027 Middle french (ca. 1400-1600) \u0027monicion\u0027 and their source, Latin {{m|la|monitio|monitiō|warning, admonition}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A caution or warning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, w:Henry Henry James, \u0027The Tragic Muse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He cherished the usual wise \u0027\u0027monitions\u0027\u0027, such as that one was not to make a fool of one\u0027s self and that one should not carry on one\u0027s technical experiments in public\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A legal notification of something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A sign of impending danger; an omen\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, ‘William Wilson’\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I recognise the first ambiguous \u0027\u0027monitions\u0027\u0027 of the destiny which afterwards so fully overshadowed me\", \"priority\":7}]}, \"synonyms\":{}}");

