	add("monkey", "{\"term\":\"monkey\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"middle low german\", \"old spanish\"], \"text\":\"{{borrowing|dum|monnekijn|lang\u003den}}, or Middle low german {{m|gml|Moneke}}, name of the son of Martin the Ape in \u0027Reynard the Fox\u0027, from Old spanish {{m|osp|mona||mona monkey}}, shortening of {{m|osp|mamona}}, variant of {{m|osp|maimón}}, from Arabic {{m|ar|مَيْمُون||fortunate, auspicious, blessed}}, used to ward off the monkey\u0027s bad luck. Compare Old French {{m|fro|Monequin}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any member of the clade Simiiformes not also of the clade Hominoidea containing humans and apes, from which they are usually, but not universally, distinguished by smaller size, a tail, and cheek pouches\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any primate, including apes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mischievous child\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Five hundred pounds sterling\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person or the role of the person on the sidecar platform of a motorcycle involved in sidecar racing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person with minimal intelligence and/or an unattractive appearanc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A face card\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A menial employee who does a repetitive job, as in code monkey, grease monkey, phone monkey, powder monkey\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The weight or hammer of a pile driver; a heavy mass of iron, which, being raised high, falls on the head of the pile, and drives it into the earth; the falling weight of a drop hammer used in forging\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A small trading vessel of the sixteenth century\", \"priority\":10}]}, \"synonyms\":{}}");

	add("monkeydom", "{\"term\":\"monkeydom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|monkey|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or essence of being a monkey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, R. L. Garner, \u0027The Speech of Monkeys\u0027, page 37\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was not an exception to that general rule which governs \u0027\u0027monkeydom\u0027\u0027, which is to suspect every one of doing wrong except itself\", \"priority\":3}]}, \"synonyms\":{}}");

