	add("monochrome", "{\"term\":\"monochrome\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μονόχρωμος\u0027 () from \u0027μόνος\u0027 (one) + \u0027χρῶμα\u0027 (color) {{confix|mono|chrome|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A black and white image, especially such a photograph\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A painting executed in shades of a single colour\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A ceramic glaze of a single colour; an object so glazed\", \"priority\":3}]}, \"synonyms\":{}}");

	add("monocle", "{\"term\":\"monocle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027monocle\u0027 from \u0027monoculus\u0027 (one-eyed) from \u0027mono-\u0027 (single) + \u0027oculus\u0027 (eye)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a single lens, usually in a wire frame, and used to correct vision for only one eye\", \"priority\":1}]}, \"synonyms\":{}}");

