	add("monocotyledon", "{\"term\":\"monocotyledon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mono|cotyledon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant whose seedlings typically have one cotyledon (seed leaf) (in contrast to the two cotyledons typical of dicots), thereby belonging to the taxonomic monocots, formerly variously known as \u0027\u0027, \u0027\u0027, or Liliopsida, a class in the Angiospermae, the flowering plants. This group include the grasses, lilies, orchids and palms\", \"priority\":1}]}, \"synonyms\":{}}");

