	add("monocycle", "{\"term\":\"monocycle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mono|cycle|lang\u003den}}, thus literally \u0026quot;one wheel.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|Benzene, a representative \u0027\u0027monocycle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A unicycle or monowheel; often specifically a unicycle with the rider seated inside the wheel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An aromatic compound containing a single ring\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The first derivative of a Gaussian, often used as an impulse signal\", \"priority\":4}]}, \"synonyms\":{}}");

