	add("monody", "{\"term\":\"monody\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027monodia\u0027 from Ancient greek (to 1453) \u0027μονῳδία\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ode, as in Greek drama, for a single voice, often specifically a mournful song or dirge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any poem mourning the death of someone; an elegy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A monotonous or mournful noise\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A composition having a single melodic line\", \"priority\":4}]}, \"synonyms\":{}}");

	add("monoecy", "{\"term\":\"monoecy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of having both male and female sex organs; hermaphrodism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the state of having pistils and stamens on separate flowers of the same plant\", \"priority\":2}]}, \"synonyms\":{}}");

