	add("monogamy", "{\"term\":\"monogamy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027monogamie\u0027 from \u0027monogamia\u0027 from Ancient greek (to 1453) \u0027μονογαμία\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of sexual bonding involving a permanent pair bond between two beings\", \"priority\":1}]}, \"synonyms\":{}}");

