	add("monoglot", "{\"term\":\"monoglot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|glot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person capable of speaking only a single language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monoglucuronide", "{\"term\":\"monoglucuronide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mono|glucuronide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any compound containing a single glucuronide group\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monograph", "{\"term\":\"monograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|t1\u003done|graph|t2\u003dwrite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scholarly book or a treatise on a single subject or a group of related subjects, usually written by one person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I had never given much thought to the role of darkness in ordinary human affairs until I read a \u0027\u0027monograph\u0027\u0027 prepared by John Staudenmaier, a historian of technology and a Jesuit priest, for a recent conference at MIT.\u0027 Cullen Murphy, \u0026quot;Hello Darkness\u0026quot;, \u0027The Atlantic Monthly\u0027, March 1996, Volume 277, No. 3, [http://www.theatlantic.com/issues/96mar/darkness/darkness.htm pp. 22-24\", \"priority\":2}]}, \"synonyms\":{}}");

