	add("monoiodotyrosine", "{\"term\":\"monoiodotyrosine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mono|iodotyrosine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A precursor of thyroid hormone that results from iodization of tyrosine at the metaposition of the phenol ring\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monokini", "{\"term\":\"monokini\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|lang\u003den|mono-|-kini}}, in analogy with the fictitious etymology {{suffix|lang\u003den|bi-|-kini}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The lower part of a bikini worn without the upper part (i.e., worn bare-breasted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, \u0026quot;Topless Triumph\u0026quot;, \u0027Time\u0027, 12 Mar 1965\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All this so impressed the Appellate Court in Aix-en-Provence that it reversed the convictions. \u0026quot;Inasmuch as the spectacle of the nudity of the human body has nothing intrinsic in it that would outrage normal, even delicate decency, and since Claudine Durand concealed her sexual parts with a sufficiently opaque \u0027\u0027monokini\u0027\u0027, we acquit her.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Angelique Crisafis, \u0026quot;France Falls Out of Love with Topless Sunbathing\u0026quot;, \u0027The Guardian\u0027, 22 Jul 09\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"French academics and historians have spent the early summer months pondering the sociological meaning of the demise of France\u0027s once-favourite piece of beachwear, the \u0026quot;\u0027\u0027monokini\u0027\u0027\u0026quot; – the bottom half of a bikini with no top\", \"priority\":5}]}, \"synonyms\":{}}");

