	add("monolithism", "{\"term\":\"monolithism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Extreme rigidity or orthodoxy of a political or ideological movement\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monomania", "{\"term\":\"monomania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"Either:* Formed in English as {{prefix|mono|mania|lang\u003den}};* From the French \u0027monomanie\u0027 or,* From the Modern Latin \u0027monomania\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Excessive interest or concentration on a singular object or subject\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was apparent to all but himself that what was once idle curiosity had become a monomania\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pathological obsession with one person, thing or idea\", \"priority\":3}]}, \"synonyms\":{}}");

	add("monomaniac", "{\"term\":\"monomaniac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is obsessed with a single thing, to the exclusion of other concerns\", \"priority\":1}]}, \"synonyms\":{}}");

