	add("monometer", "{\"term\":\"monometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A line of verse containing a single metrical foot\", \"priority\":1}]}, \"synonyms\":{}}");

