	add("monomoraicity", "{\"term\":\"monomoraicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of having one mora\", \"priority\":1}]}, \"synonyms\":{}}");

