	add("mononym", "{\"term\":\"mononym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|gloss1\u003done|onym|gloss2\u003dword, name|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single name by which a person, thing etc is known. For example, Madonna (the pop musical artist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophage", "{\"term\":\"monophage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|phage|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monophagous animal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophagy", "{\"term\":\"monophagy\", \"etymology\":{\"influencers\":[], \"languages\":[\"ancient greek (to 1453)\"], \"text\":\"{{confix|mono|phagy|lang\u003den}}. Compare Ancient greek (to 1453) \u0027μονοφαγία\u0027 (eating alone)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The feeding on a single type of food (e.g., a single plant species\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophasia", "{\"term\":\"monophasia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|phasia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of aphasia where the sufferer is only able to speak a single word or sentence\", \"priority\":1}]}, \"synonyms\":{}}");

