	add("monophosphonucleoside", "{\"term\":\"monophosphonucleoside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mono|phosphonucleoside|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nucleoside monophosphate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophthong", "{\"term\":\"monophthong\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μονόφθογγος\u0027 () from \u0027μόνος\u0027 (single) + \u0027φθόγγος\u0027 (sound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vowel (in the sense of a sound rather than a letter of the alphabet) that has the same sound throughout its pronunciation, such as the short vowels in \u0026quot;pap\u0026quot;, \u0026quot;pep\u0026quot;, \u0026quot;pip\u0026quot;, \u0026quot;pop\u0026quot; and \u0026quot;pup\u0026quot;, as opposed to a diphthong (eg, /aɪ/, the vowel in \u0026quot;pipe\u0026quot;) or a triphthong (eg, /aɪə/, the sound in the non-rhotic pronunciation of \u0026quot;pyre\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophylly", "{\"term\":\"monophylly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being monophyllous (having a single leaf\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monophyly", "{\"term\":\"monophyly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In cladistics, the condition of being monophyletic, of including all descendants from a given ancestral species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 January 15, Martin D. Brazeau, “The braincase and jaws of a Devonian \u0027acanthodian\u0027 and modern gnathostome origins”, \u0027Nature\u0027 Volume 457 No. 7227, doi:10.1038/nature07436\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All of these studies have presupposed acanthodian \u0027\u0027monophyly\u0027\u0027 and stereotyped acanthodian endoskeletal morphology on Acanthodes , the latest-occurring, and a highly apomorphic genus\", \"priority\":3}]}, \"synonyms\":{}}");

