	add("monopsony", "{\"term\":\"monopsony\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{prefix|mon|lang\u003den}} Ancient greek (to 1453) \u0027ὀψωνέω\u0027 (buy products) {{suffix||y|lang\u003den}}.Coined by classics scholar {{w|Bertrand Hallward}} of {{w|Peterhouse College, Cambridge}}, popularized by economist {{w|Joan Robinson}} in her 1933 book, \u0027The Economics of Imperfect Competition.\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A market situation in which there is only one buyer for a product; such a buyer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A buyer with disproportionate power\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21598997-american-regulators-should-block-comcasts-proposed-deal-time-warner-cable-turn-it Turn it passage\u003dIf the takeover is approved, Comcast would control 20 of the top 25 cable markets, […]. Antitrust officials will need to consider Comcast’s status as a \u0027\u0027monopsony\u0027\u0027 (a buyer with disproportionate power), when it comes to negotiations with programmers, whose channels it pays to carry\", \"priority\":3}]}, \"synonyms\":{}}");

