	add("monotheism", "{\"term\":\"monotheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A learned 17th-century coinage, {{prefix|mono|theism|lang\u003den}}, from (\u0027μονός\u0027 (one) and (\u0027θεός\u0027 (god, deity) + \u0027lang\u003dgrc\u0027 The term parallels the earlier polytheism, atheism (the simplex theism being slightly later).The earliest known use is by Henry More, ca. 1660, in explicit juxtaposition with both \u0027atheism\u0027 and \u0027polytheism\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief in a single deity (one god or goddess); especially within an organized religion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monothelete", "{\"term\":\"monothelete\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"Variant form of \u0027\u0027 after its etymon, \u0027μονοθελήτης\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who believed Christ had two natures (human and divine), but one single will; a Monothelite\", \"priority\":1}]}, \"synonyms\":{}}");

