	add("monotreme", "{\"term\":\"monotreme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mono|treme|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Monotreme reproductive thumb|Ventral view of a female echidna, a \u0027\u0027monotreme\u0027\u0027, showing single orifice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mammal that lays eggs and has a single urogenital and digestive orifice. Only the echidnas and platypuses are included in this group\", \"priority\":2}]}, \"synonyms\":{}}");

