	add("monsoon", "{\"term\":\"monsoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Dutch\", \"Portuguese\"], \"text\":\"From Arabic \u0027مَوْسِم|lang\u003dar\u0027 () from \u0027وَسَمَ|lang\u003dar\u0027 (to mar. verb) through Portuguese \u0027monção\u0027 and Dutch \u0027moesson\u0027. \u0026lt;ref\u0026gt;[http://www.bartleby.com/61/21/M0402100.html The American Heritage Dictionary of the English Language], Fourth Edition. 2000 Houghton Mifflin\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://dsal.uchicago.edu/cgi-bin/philologic/getobject.pl?c.7:1:1316.platts A Dictionary of Urdu, classical Hindi, and English] Platts.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a number of winds associated with regions where most rain falls during a particular season\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tropical rainy season when the rain lasts for several months with few interruptions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/asia/21580209-natural-disaster-aggravated-poor-response-high-and-wet High and passage\u003dFloods in northern India, mostly in the small state of Uttarakhand, have wrought disaster on an enormous scale. The early, intense onset of the \u0027\u0027monsoon\u0027\u0027 on June 14th swelled rivers, washing away roads, bridges, hotels and even whole villages. Rock-filled torrents smashed vehicles and homes, burying victims under rubble and sludge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The rains themselves\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Entire meteorological systems with such characteristics\", \"priority\":5}]}, \"synonyms\":{}}");

	add("monsterization", "{\"term\":\"monsterization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|monster|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the transformation of something or someone into a monster either literally or figatuvel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Jeffrey Jerome Cohen, \u0027Of giants: sex, monsters, and the Middle Ages\u0027, page 132\u0026lt;!---[http://books.google.com/books?id\u003d7LlrQLbsHGYC\u0026amp;pg\u003dPA132\u0026amp;dq\u003dmonsterization\u0026amp;hl\u003den\u0026amp;ei\u003d2jK_Tq156M6IAoXczKQD\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;sqi\u003d2\u0026amp;ved\u003d0CD4Q6AEwAw]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A similar but less spectacular technology of \u0027\u0027monsterization\u0027\u0027 propels the representation of Islam in England, where the \u0026quot;Saracen threat\u0026quot; never encroached and therefore was always in danger of seeming fantastic and remote\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Belinda Morrissey, \u0027When women kill: questions of agency and subjectivity\u0027, page 25\u0026lt;!---[http://books.google.com/books?id\u003dfewUIbJHyy0C\u0026amp;pg\u003dPA25\u0026amp;dq\u003dmonsterization\u0026amp;hl\u003den\u0026amp;ei\u003d2jK_Tq156M6IAoXczKQD\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;sqi\u003d2\u0026amp;ved\u003d0CDQQ6AEwAQ]---\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Vilification/\u0027\u0027monsterization\u0027\u0027 denies agency by insisting upon the evil nature of the murderess, thus causing her to los\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Michael Finkel, \u0027True Story: Murder, Memoir, Mea Culpa\u0027\u0026lt;!---[http://books.google.com/books?id\u003d2Kl83R6U7aIC\u0026amp;pg\u003dPT313\u0026amp;dq\u003dmonsterization\u0026amp;hl\u003den\u0026amp;ei\u003d2jK_Tq156M6IAoXczKQD\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;sqi\u003d2\u0026amp;ved\u003d0CF4Q6AEwCQ]---\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“I\u0027d admit the past \u0026amp; monsterize myself in the eyes of the jury,” he wrote. “I would try to be emotionless, to add credibility to that \u0027\u0027monsterization\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cultural anthropologists undoubtedly relish in the study of the \u0027\u0027monsterization\u0027\u0027 of Michael Jackson\", \"priority\":8}]}, \"synonyms\":{}}");

	add("monsterlet", "{\"term\":\"monsterlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|monster|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small monster\", \"priority\":1}]}, \"synonyms\":{}}");

	add("monstrance", "{\"term\":\"monstrance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Image:Koeln monstranz im Domschatz.jpg|thumb|right|150px|\u0027\u0027Antique Monstrance from Cologne\u0027\u0027From post-classical Latin \u0027monstrantia\u0027 from classical Latin {{m|la|monstrāns}}, present participle of \u0027monstro\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ornamental, often precious receptacle, either open or with a transparent cover, in which the sacramental bread is placed for veneration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, Oscar Wilde, \u0027The Picture of Dorian Gray\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d746282105\u0026amp;tag\u003dWilde,+Oscar:+The+Picture+of+Dorian+Gray,+1890\u0026amp;query\u003dmonstrance\u0026amp;id\u003dWilDori Chapter 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He loved to kneel down on the cold marble pavement and watch the priest, in his stiff flowered dalmatic, slowly and with white hands moving aside the veil of the tabernacle, or raising aloft the jewelled, lantern-shaped \u0027\u0027monstrance\u0027\u0027 with that pallid wafer that at times, one would fain think, is indeed the \u0026quot;panis caelestis,\u0026quot; the bread of angels, or, robed in the garments of the Passion of Christ, breaking the Host into the chalice and smiting his breast for his sins\", \"priority\":3}]}, \"synonyms\":{}}");

	add("monstrosity", "{\"term\":\"monstrosity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027monstrositas\u0027 () from Latin {{m|la|monstrōsus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant or animal showing abnormal development or deformity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, \u0027The Origin of Species\u0027, I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Geoffrey St Hilaire\u0027s experiments show that unnatural treatment of the embryo causes \u0027\u0027monstrosities\u0027\u0027; and \u0027\u0027monstrosities\u0027\u0027 cannot be separated by any clear line of distinction from mere variations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A monstrous thing, person or act\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The state of being monstrous\", \"priority\":5}]}, \"synonyms\":{}}");

	add("month", "{\"term\":\"month\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Old Church Slavonic\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"ancient greek (to 1453)\", \"Armenian\", \"Icelandic\", \"Latin\", \"Dutch\", \"scots\", \"old irish (to 900)\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|month}}, {{m|enm|moneth}}, from Old english (ca. 450-1100) {{m|ang|monaþ||month}}, from Proto-germanic {{m|gem-pro|*mēnōþs||month}}, from Proto-indo-european {{m|ine-pro|*mḗh₁n̥s||moon, month}}, probably from Proto-indo-european {{m|ine-pro|*mê-||to measure}}, referring to the moon\u0027s phases as the measure of time, equivalent to {{suffix|moon|th|lang\u003den}}. Cognate with Scots {{m|sco|moneth||month}}; Northern frisian {{m|frr|muunt||month}}; Saterfriesisch {{m|stq|Mound||month}}, Dutch {{m|nl|maand||month}}; German low german {{m|nds-de|Maand}}, {{m|nds-de|Monat||month}}; German {{m|de|Monat||month}}; Danish {{m|da|måned||month}}; Swedish {{m|sv|månad||month}}; Icelandic {{m|is|mánuði||month}}; Latin {{m|la|mēnsis||month}}; Ancient greek (to 1453) {{m|grc|μήν}}; Armenian {{m|hy|ամիս}}; Old irish (to 900) {{m|sga|mí}}; Old church slavonic {{m|cu|мѣсѧць}}. See also {{l|en|moon}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The plural is occasionally seen as \u0027\u0027month\u0027\u0027 (unchanged\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A period into which a year is divided, historically based on the phases of the moon. In the Gregorian calendar there are twelve months: January, February, March, April, May, June, July, August, September, October, November and December\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21582498-america-has-changed-way-it-measures-gdp-boundary-problems Boundary passage\u003dEconomics is a messy discipline: too fluid to be a science, too rigorous to be an art. Perhaps it is fitting that economists’ most-used metric, gross domestic product (GDP), is a tangle too. GDP measures the total value of output in an economic territory. Its apparent simplicity explains why it is scrutinised down to tenths of a percentage point every \u0027\u0027month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A period of 30 days, 31 days, or some alternation thereof\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dCharles had not been employed above six \u0027\u0027months\u0027\u0027 at Darracott Place, but he was not such a whopstraw as to make the least noise in the performance of his duties when his lordship was out of humour\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s period; menstrual discharge\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"vol.I, New York, 2001, p.234\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sckenkius hath two other instances of two melancholy and mad women, so caused from the suppression of their \u0027\u0027months\", \"priority\":8}]}, \"synonyms\":{}}");

